@Jmvillar El problema de emplear "Protrusión" se debe a que esta palabra se usa como un término médico no como un término e ingeniería. Habría que buscar otro término o dejar ambos como "Extrusión" Definiciones de la RAE:
protrusión. Acción y efecto de protruir.
protuir. Dicho de una parte o de un órgano: Desplazarse hacia delante, sobresalir de sus límites normales, de forma natural o patológica.

